  false,\n\t\"url\": null,\n\t\"notes\": \"The Des Lacs National Wildlife Refuge Water
  Management Plan has been developed to meet the station objectives set forth in the
  Master Plan.  This plan contains annual water use reports and management plans for
  the Des Lacs NWR Complex, including Lostwood NWR, Lake Zahl NWR, Shell Lake NWR,
  and Sikes WPA. The purpose of this plan is to establish a schedule of operations
  for the manipulation of managed waters.  The previous year's water usage (1997)
  and next year's (1998) plan is summarized. Each water unit's management is covered
  including future management and recommended water levels.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
